INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6768, SYSDATE, NULL, NULL, NULL, 'SVDCDYGWS02', 'e18225486x', 'e18225486x', NULL, 3, 1, 1, 1, 0, 1, 1, 1, '/DatosEspecificos/DatosSalida/pdf', 1.0, 1, 1, 0, 1, 1, 'El Servicio de Obtención de Certificado de Descriptiva y Gráfica proporciona la certificación descriptiva y gráfica en un fichero pdf incluido en una de las etiquetas del mensaje XML.<br>Se ha de identificar unívocamente el inmueble en el mensaje de petición mediante los códigos (INE) de provincia y municipio, más los 18 primeros dígitos de la referencia catastral, o bien el polígono y la parcela en caso de que fuera un inmueble rústico.<br>Los datos de los distintos certificados serán proporcionados por la Dirección General de Catastro. No se devolverán datos de los terriotorios de Navarra y País Vasco', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6771, SYSDATE, NULL, NULL, NULL, 'SVDDGPCIWS02', 'e18225486x', 'e18225486x', NULL, 4, 1, 1, 0, 0, 1, 1, 1, NULL, 0.0, 1, 0, 0, 1, 1, '<b>Número de documento según el TipoDocumentacion.</b> En el caso de un ciudadano español, este campo es obligatorio. En el caso de ciudadanos extranjeros este campo no es obligatorio, pero sino se especifica, se deberá completar el campo NumeroSoporte Este campo contiene el número de documento del ciudadano del que se quiere consultar sus datos, según se trate de un ciudadano español o extranjero. La codificación de este campo es la siguiente:<br><ul><li>DNI (ciudadano español): 8 dígitos + Carácter Control.</li><li>NIE (ciudadano extranjero): [X,Y,Z] + 7 dígitos + Carácter Control.</li></ul>Aquellos DNIs y DNIs que tengan menos de 8 dígitos deberán ser rellenados con 0´s por la izquierda<br><br><b>Número soporte.</b> Contiene información para realizar la consulta sobre con un Número de Soporte.<br><ul><li>Ciudadano español: Es el campo IDESP del DNIe. Su codificación es 3 caracteres alfanuméricos + 6 dígitos (i.e. AAA123456)</li><li>Ciudadano extranjero comunitario: Su codificación es "C"+ 8 dígitos correspondiendo este número de soporte con el Certificado Comunitario</li><li>Ciudadano extranjero: Su codificación es "E"+ 8 dígitos (estos 8 dígitos coinciden con el número de tarjeta de identificación de extranjero).<br></li></ul>Este campo será obligatorio si el ciudadano es extranjero y no se ha introducido el NIE del mismo en el campo Documentacion.<br>Se debe de tener en cuenta que el campo que identifica de forma unívoca a un ciudadano extranjero es el TIE, por lo que si sobre la consulta no se introduce este valor y se introduce el NIE es posible que el resultado del sistema no sea el esperado. Se podría dar el caso de que se localizarán dos registros correspondientes a un mismo NIE.<br>Para una mejora sobre la consulta se recomienda acotar con mayor exactitud los parámetros de la misma o incluir siempre el valor del TIE en el caso de un ciudadano extranjero.<br>', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6772, SYSDATE, NULL, NULL, NULL, 'SVDDGPVIWS02', 'e18225486x', 'e18225486x', NULL, 5, 1, 1, 0, 0, 1, 1, 1, NULL, 0.0, 1, 0, 0, 0, 1, 'El Servicio de Verificación de Datos de Identidad (SVDDGPVIWS02) será el encargado consultar los datos de Identidad de un ciudadano.El servicio de verificación de datos de identidad permite verificar los datos de identidad del ciudadano objeto de la consulta<br>Los datos de los distintos certificados serán proporcionados por la DGP.<b><br><br>Número de documento según el TipoDocumentacion.</b> En el caso de un ciudadano español, este campo es obligatorio. En el caso de ciudadanos extranjeros este campo no es obligatorio, pero sino se especifica, se deberá completar el campo NumeroSoporte dentro del nodo datosEspecificos. Este campo contiene el número de documento del ciudadano del que se quiere consultar sus datos, según se trate de un ciudadano español o extranjero. La codificación de este campo es la siguiente:<br><ul><li>DNI (ciudadano español): 8 dígitos + Carácter Control.</li><li>NIE (ciudadano extranjero): [X,Y,Z] + 7 dígitos + Carácter Control.<br></li></ul>Aquellos DNIs y NIEs que tengan menos de 8 dígitos deberán ser rellenados con 0´s por la izquierda.<br><br><b>Número de Soporte</b>. Contiene información para realizar la consulta sobre con un Número de Soporte.<br><ul><li>Ciudadano español: Es el campo IDESP del DNIe. Su codificación es 3 caracteres alfanuméricos + 6 dígitos (i.e. AAA123456)</li><li>Ciudadano extranjero comunitario: Su codificación es "C"+ 8 dígitos correspondiendo este número de soporte con el Certificado Comunitario.</li><li>Ciudadano extranjero: Su codificación es "E"+ 8 dígitos (estos 8 dígitos coinciden con el número de tarjeta de identificación de extranjero).<br></li></ul>Este campo será obligatorio si el ciudadano es extranjero y no se ha introducido el NIE del mismo en el campo Documentacion.<br>Se debe de tener en cuenta que el campo que identifica de forma univoca a un ciudadano extranjero es el TIE, por lo que si sobre la consulta no se introduce este valor y se introduce el NIE es posible que el resultado del sistema no sea el esperado. Se podría dar el caso de que se localizarán dos registros correspondientes a un mismo NIE.<br>Para una mejora sobre la consulta se recomienda acotar con mayor exactitud los parámetros de la misma o incluir siempre el valor del TIE en el caso de un ciudadano extranjero.<br><br><b>Fecha de Nacimiento del ciudadano. </b>Formato: AAAAMMDD. Si los datos del día y del mes son desconocidos para un ciudadano extranjero, se deberá preguntar por 99 para ambos datos, siendo el año obligatorio que venga correctamente informado, Por ejemplo: 19749999<b><br><br>Código de la Província de naciomiento del ciudadano. </b>Este campo irá codificado con los códigos del INE (2 dígitos). Si el ciudadano es extranjero, el código de Provincia será el 66. <a href="http://www.ine.es/daco/daco42/codmun/cod_provincia.htm">http://www.ine.es/daco/daco42/codmun/cod_provincia.htm</a><br><b><br>Código del país de nacimiento del ciudadano</b>. Este campo va codificado según la normativa OACI (o en inglés ICAO) que codifica con 3 caracteres todos los países/nacionalidades.<br><ul><li>Caso de un ciudadano español: si la provincia de nacimiento es española, este campo va codificado con el código OACI ESP e indica que el país de nacimiento es España. Si es un ciudadano español que no nació en España, este campo vendrá codificado con el código OACI de su país de nacimiento.</li><li>Caso de ciudadano extranjero: Este campo tiene la codificación OACI de su país de nacimiento.</li></ul><p>Códigos: <a href="https://en.wikipedia.org/wiki/ISO_3166-1_alpha-3">https://en.wikipedia.org/wiki/ISO_3166-1_alpha-3</a></p>', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
