INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6769, SYSDATE, NULL, NULL, NULL, 'SVDTNUWS03', 'e18225486x', 'e18225486x', NULL, 3, 0, 1, 1, 0, 1, 1, 1, NULL, 0.0, 1, 0, 1, 1, 1, '<b>Número de documento según el TipoDocumentacion</b>. Este campo contiene el número de documento del ciudadano del que se quiere consultar sus datos, según se trate de un ciudadano español o extranjero. La codificación de este campo es la siguiente:<br><ul><li>NIF (ciudadano español): 8 dígitos + Carácter Control.</li></ul><ul><li>NIE (ciudadano extranjero): [X,Y,Z] + 7 dígitos + Carácter Control.</li></ul>Aquellos NIFs y NIEs que tengan menos de 8 dígitos deberán ser rellenados con 0´s por la izquierda', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6770, SYSDATE, NULL, NULL, NULL, 'SVDTUWS03', 'e18225486x', 'e18225486x', NULL, 2, 0, 1, 1, 0, 1, 1, 1, NULL, 0.0, 1, 0, 1, 1, 1, '<b>Número de documento según el TipoDocumentacion</b>. Este campo contiene el número de documento del ciudadano del que se quiere consultar sus datos, según se trate de un ciudadano español o extranjero. La codificación de este campo es la siguiente:<br><ul><li>NIF (ciudadano español): 8 dígitos + Carácter Control.</li><li>NIE (ciudadano extranjero): [X,Y,Z] + 7 dígitos + Carácter Control.</li></ul>Aquellos NIFs y NIEs que tengan menos de 8 dígitos deberán ser rellenados con 0´s por la izquierda', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6773, SYSDATE, NULL, NULL, NULL, 'SVDSEPEIACTWS02', 'e18225486x', 'e18225486x', NULL, 2, 1, 1, 1, 0, 1, 1, 1, NULL, 0.0, 1, 0, 1, 1, 1, 'El Servicio de Consulta de Importes de Prestaciones percibidas a Fecha Actual (SVDSEPEIACTWS02) será el encargado de proporcionar los importes de las prestaciones actualmente percibidas por un desempleado, proporcionando:<br><ul><li>El tipo de prestación o subsidio del último derecho reconocido</li><li>La fecha de inicio y fin de la situación actual del derecho</li><li>La Base Reguladora diaria</li><li>La Cuantía del importe bruto</li><li>El importe de la cuota fija del REASS</li><li>El importe de la retención a efectos de IRPF</li><li>El importe del descuento de la seguridad social</li></ul>', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6774, SYSDATE, NULL, NULL, NULL, 'SVDSEPEIPERWS02', 'e18225486x', 'e18225486x', NULL, 3, 1, 1, 1, 0, 1, 1, 1, NULL, 0.0, 1, 0, 1, 1, 1, '<b>Fecha de inicio del periodo</b> (formato: MM/AAAA) Deberá cumplir las siguientes restricciones:<br>• No podrá remontarse a más de 5 años de la Fecha Actual<br>• No podrá ser mayor que la Fecha Actual<br><b>Fecha de fin del periodo</b> (formato: MM/AAAA) Deberá cumplir las siguientes restricciones:<br>• No podrá superar los 12 meses de diferencia respecto a FXINICIO<br>• No podrá ser mayor que la fecha actual<br>• No podrá ser inferior a FXINICIO<br><br>El Servicio de Consulta de Importes de Prestaciones percibidas en un Periodo (SVDSEPEIPERWS02) será el encargado consultar las prestaciones percibidas por un desempleado durante un periodo de tiempo determinado. El periodo requerido no podrá distar de más 5 años desde la fecha actual, ni suponer un periodo mayor a un año. El servicio proporciona la siguiente información:<br><ul><li>La fecha de inicio y fin de la situación actual del derecho</li><li>La Cuantía del importe bruto</li><li>El importe de la cuota fija del REASS</li><li>El importe de la retención a efectos de IRPF</li><li>El importe del descuento de la seguridad social</li></ul>', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6775, SYSDATE, NULL, NULL, NULL, 'SVDSEPESITWS02', 'e18225486x', 'e18225486x', NULL, 2, 1, 1, 1, 0, 1, 1, 1, NULL, 0.0, 1, 0, 1, 1, 1, 'Es obligatorio especificar el DNI. El nombre, primer apellido, segundo apellido o nombre completo es opcional.<br><br>El Servicio de Consulta de Situación Actual de Desempleo (SVDSEPESITWS02) será el encargado de proporcionar información de la situación actual de prestaciones percibidas por un desempleado. El servicio proporciona:<br><ul><li>El tipo de prestación recibida por el ciudadano</li><li>La situación de dicha prestación (ALTA, BAJA o BAJA por APRE)</li><li>Las fechas de inicio y fin de la situación actual del derecho</li><li>El número total de días reconocidos sobre el derecho total</li><li>El número de días consumidos</li><li>La Base reguladora diaria</li><li>La Base de contingencias comunes</li><li>Los indicadores de retención judicial, embargo y Cobro indebido</li></ul>', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6805, SYSDATE, NULL, NULL, NULL, 'SVDCBIWS02', 'e18225486x', 'e18225486x', NULL, 1, 1, 1, 1, 1, 1, 1, 1, NULL, 0.0, 1, 1, 0, 1, 1, 'El Servicio de Consulta de Bienes e Inmuebles proporciona información de datos catastrales de acuerdo a la Referencia Catastral introducida o a través de la referencia de polígono y/o parcela.<br><ul><li>Consulta por Referencia Catastral</li><li>Consulta por Polígono y Parcela</li></ul>La consulta debe ser <b>excluyente</b>, es decir, o bien se consulta por referencia catastral o bien se consulta a través de la referencia rústica.<br>En el caso de que se rellenen los dos bloques, la consulta que se realiza a Catastro es la contenida en el primer bloque de referencia Catastral.<br>Los datos de los distintos certificados serán proporcionados por la Dirección General de Catastro. No se devolverán datos de los territorios de Navarra y País Vasco<br>', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
