INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6766, SYSDATE, NULL, NULL, NULL, 'SVDCTITWS02', 'e18225486x', 'e18225486x', NULL, 10, 1, 1, 0, 1, 0, 0, 0, '/DatosEspecificos/DatosSalida/pdf', 1.0, 1, 1, 0, 0, 1, 'El Servicio de Certificación de Titularidad proporciona datos de certificación de titularidad de un bien inmueble. Permite obtener una certificación de titularidad catastral, es decir un documento que certifica los inmuebles asociados a un titular catastral, o bien la circunstancia de no figurar como titular catastral de bienes inmuebles en la base de datos del Catastro:<br><ul><li>La consulta se realiza por DNI o NIE o CIF, pero se puede limitar el ámbito de la consulta para una comunidad autónoma, dentro de esta una provincia y dentro de esta un municipio. También se puede limitar la consulta por tipología de los bienes inmuebles (urbanos, rústicos o de características especiales).</li></ul>Los datos de los distintos certificados serán proporcionados por la Dirección General de Catastro. No se devolverán datos de los terriotorios de Navarra y País Vasco.<br><br><b>Número de documento según el TipoDocumentacion.</b> Este campo contiene el número de documento del ciudadano del que se quiere consultar sus datos, según se trate de un ciudadano español o extranjero. La codificación de este campo es la siguiente:<br><ul><li>DNI (ciudadano español): 8 dígitos + Carácter Control.</li><li>NIE (ciudadano extranjero): [X,Y,Z] + 7 dígitos + Carácter Control.<br></li></ul>Aquellos DNIs y DNIs que tengan menos de 8 dígitos deberán ser rellenados con 0´s por la izquierda<br><br><b>Comunitat Autònoma</b>:<br>01 ANDALUCIA<br>02 ARAGON<br>03 P. ASTURIAS<br>04 ILLES BALEARS<br>05 CANARIAS<br>06 CANTABRIA<br>07 CASTILLA-MANCHA<br>08 CASTILLA Y LEON<br>09 CATALUÑA<br>10 EXTREMADURA<br>11 GALICIA<br>12 C. MADRID<br>13 R. MURCIA<br>14 C. F. NAVARRA<br>15 PAIS VASCO<br>16 LA RIOJA<br>17 C. VALENCIANA<br>18 CEUTA<br>19 MELILLA<br><br><div>https://intermediacionpp.redsara.es/servicios/SVD/Catastro.CertificacionTitular</div>', NULL, 'application/octet-stream', NULL, 1, NULL, 1, 0, NULL, 1, 0, 1, 0);
INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (6767, SYSDATE, NULL, NULL, NULL, 'SVDCDATWS02', 'e18225486x', 'e18225486x', NULL, 7, 1, 1, 1, 1, 1, 1, 1, NULL, 0.0, 1, 1, 0, 1, 1, 'El Servicio de Consulta de Datos Catastrales proporciona información de datos catastrales de acuerdo a diferentes parámetros de búsqueda:<br><ul><li>Búsqueda por DNI o NIE o CIF y Apellidos y Nombre: Devuelve todos los datos catastrales de los inmuebles que figuran en la base de datos del catastro asociados a ese DNI o NIE o CIF. En caso de incluir el Apellidos y Nombre la búsqueda se acota.</li></ul>No es posible realizar búsquedas mediante el tipo de documentación Pasaporte, debido a que catastro asocia los ciudadanos a un NIF.<br>Los datos de los distintos certificados serán proporcionados por la Dirección General de Catastro. No se devolverán datos de los territorios de Navarra y País Vasco.', NULL, 'application/octet-stream', NULL, 1, NULL, 1, 0, NULL, 0, 0, 1, 0);
